import React, { useState } from "react";
import "./App.css";
import Navbar from "./components/navbar";
import Banner from "./components/banner";
import WhatPage from "./components/what_page";
import WhyPage from "./components/why_page";
import PreOrder from "./components/pre_order";
import Footer from "./components/footer";

function App() {
  const [background, setBackground] = useState("#303030");
  const changeToBlack = () => {
    setBackground("#303030");
  };
  const changeToDarkGreen = () => {
    setBackground("#1d3c27");
  };
  return (
    <div className="App">
      <Navbar background={background ? "#303030" : "#1d3c27"} />
      <Banner />
      <WhatPage />
      <WhyPage />
      <PreOrder background={background ? "#303030" : "#1d3c27"} />
      <Footer
        background={background ? "#303030" : "#1d3c27"}
        changeBackground={changeToBlack}
      />
    </div>
  );
}

export default App;
